module.exports = "\n<body class=\"gray-bg\">\n<div class=\"row\">\n    <div class=\"col-lg-12\">\n        <div class=\"ibox float-e-margins\" style=\"margin-top: 15px;\">\n            <div class=\"ibox-title\">\n                <h5>Guides</h5>\n            </div>\n            <div class=\"ibox-content\"><h3><a href=\"../../files/quickstart.pdf\">Quickstart Guide</a> </h3>\n                <div class=\"panel-body\">\n                    <div class=\"panel-group\" id=\"accordion\">\n                        <div class=\"panel panel-default\">\n                            <div class=\"panel-heading\">\n                                <h5 class=\"panel-title\">\n                                    <a data-toggle=\"collapse\" data-parent=\"#accordion\" href=\"#collapseOne\">Map guide</a>\n                                </h5>\n                            </div>\n                            <div id=\"collapseOne\" class=\"panel-collapse collapse in\">\n                                <div class=\"panel-body\">\n                                    <h2>Toolbox</h2>\n                                    <h3>Basemap</h3>\n                                    <p>The basemap dropdown allows the selection of the source of the underlying imagery on the map. Only one basemap can be active at a time. </p>\n                                    <p>Four basemap options are available. They are the Default, Satellite, Hybrid, or Dark.</p>\n                                    <h5>Default</h5>\n                                    <p>The Default basemap contains political boundaries and features, as well as basic geographic features such as lakes, rivers, and wetlands.</p>\n                                    <h5>Satellite</h5>\n                                    <p>The Satellite basemap is a pure satellite layer with no political features.</p>\n                                    <h5>Hybrid</h5>\n                                    <p>The Hybrid basemap contains political features like cities and roads on top of a satellite imagery layer</p>\n                                    <h5>Dark</h5>\n                                    <p>The Dark basemap is a non-satellite imagery layer with very dark styling.\n                                        This layer can provide better contrast with the lightly coloured soil polygons, particularly when a query result contains a small number of soil polygons. </p>\n\n                                    <h3>Theme</h3>\n                                    <p>The theme dropdown changes the styling of the soil polygons based on predefined categories. </p>\n                                    <p>Five themes are available. They are map unit, agricultural capability, texture, salinity, and electrical conductivity (pH). </p>\n\n                                    <h3>Toggles and Opacity</h3>\n                                    <p>Both the soil polygons and the Canadian Treaty boundaries can be toggled using the switches. Soil polygon opacity can be adjusted using the slider.\n                                    Adjusting the opacity of the polygons can allow inspection of the soil boundaries with geographic context provided by the also visible basemap.</p>\n\n                                    <h3>Point Datatypes</h3>\n                                    <p>A variety of point datatypes are stored by SKSIS. They are photos, soil pits, publications, and observations. By checking the associated box,\n                                    map indicators of the presence of each point datatpye will be togged on or off. </p>\n\n                                    <h2>Querybox</h2>\n                                    <h3>Filtering</h3>\n                                    <p>The filtering tools allow the selection and display of polygons that meet certain criteria specified with the dropdown menus. SKSIS allows querying\n                                    on dominant slope class, dominant slope length, salinity class, irrigation potential, surface texture, secondary texture, pH, past erosion class, stoniness class, and map unit.</p>\n\n                                    <h3>Searching</h3>\n                                    <p>The search tools allow one to move the map to certain geographic locations without scrolling. Currently, you can search by legal land description or latitude and longitude.</p>\n\n                                    <h2>Soil Info Box</h2>\n                                    <p>The soil infobox provides on the fly information such as the latitude and longitude of a click on the map, the latitude and logitude of the mouse on the map, and the\n                                    current scale of the map.</p>\n                                    <p>Upon clicking on a polygon, the soil info box will display information related to that polygon and its components.</p>\n                                </div>\n                            </div>\n                        </div>\n                        <div class=\"panel panel-default\">\n                            <div class=\"panel-heading\">\n                                <h4 class=\"panel-title\">\n                                    <a data-toggle=\"collapse\" data-parent=\"#accordion\" href=\"#collapseTwo\">Data collection guide</a>\n                                </h4>\n                            </div>\n                            <div id=\"collapseTwo\" class=\"panel-collapse collapse\">\n                                <div class=\"panel-body\">\n                                    <h2>Adding your data to the map</h2>\n                                    <p>You can upload your own soil data to SKSIS. We accept photos of soils and landscapes, georeferenced publications, soil pit descriptions, and observations. </p>\n                                    <p>Observations are simple, short descriptions of an interesting landscape or soil property at a particular location.</p>\n                                    <p>The steps below give an example of uploading a photo.</p>\n                                    <ol>\n                                        <li>Select the \"Add Data\" menu option</li>\n                                        <li>Select \"Photo\" from the Datatype menu</li>\n                                        <li>Enter the latitude and longitude of the photo</li>\n                                        <li>Add a description of the contents of the photo to the Description field</li>\n                                        <li>Click \"Select file\" and find the image on your computer</li>\n                                        <li>Click \"Upload\"</li>\n                                    </ol>\n\n                                </div>\n                            </div>\n                        </div>\n                        <div class=\"panel panel-default\">\n                            <div class=\"panel-heading\">\n                                <h4 class=\"panel-title\">\n                                    <a data-toggle=\"collapse\" data-parent=\"#accordion\" href=\"#collapseThree\">User registration guide</a>\n                                </h4>\n                            </div>\n                            <div id=\"collapseThree\" class=\"panel-collapse collapse\">\n                                <div class=\"panel-body\">\n                                    Under construction\n                                </div>\n                            </div>\n                        </div>\n                    </div>\n                </div>\n\n            </div>\n        </div>\n    </div>\n\n</div>\n";

